INSERT INTO `content_management` (`id`, `section`, `name`, `slug`, `content`) VALUES
(1, 'About', 'Our Story', '3--1', '<p><span style=\"font-size:20px;\">&nbsp; &nbsp; &nbsp;&nbsp;&nbsp;&nbsp;Crossroads Community Church was founded by four couples in 1991 who were dreaming of a church that could connect with people who were uncomfortable with traditional church. The church began by focusing on providing a contemporary, relevant Sunday morning worship experience that encouraged both believers and people seeking God for the first time. In the early years Crossroads met in rented facilities in the South Lyon community. In 2005 the church purchased land to build a permanent home and began holding worship services in the new building in March of 2008. Since that time the building has expanded and so has the focus. We still hold to the original vision of providing a worship service that is relevant to people’s daily lives. We want both newcomers and long-term believer’s to understand the message of Jesus clearly and to be empowered to live Jesus call to love God and our neighbor.</span></p><span style=\"font-size:20px;\">\n\n</span><p><span style=\"font-size:20px;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;As we have established a permanent presence in the community we have longed for the church to truly be a part of the community and to be a blessing. To that end, we have established Renewed Hope Counseling Center and Crossroads Christian Early Education. The counseling center is staffed by state licensed counselors who bring a Christian perspective to their work. The Early Education Center is a licensed day care that provides care to children from infancy through preschool. In addition, the church hosts AA and Al-Anon meetings, Tai Chi and Yoga, as well as Bible Studies and Life Groups. Beyond South Lyon we maintain a close relationship with City Covenant Church, a church we helped get started in the Brightmoor Community of Detroit. We provide a monthly meal for their food program and have led Vacation Bible School there as well. In 1991 the first families of our church founded a community church. That’s what we long to be, you are welcome to join us on the journey.</span><br></p>'),
(2, 'Home', 'Service Times (Desktop)', '1--1', '<h2 style=\"text-align: center;\"><span style=\"font-size:36px;\">WORSHIP SERVICE TIMES<br>8:30AM<br>​​​​​​​10:00AM<br></span></h2><h2 style=\"text-align: center;\"><span style=\"font-size:24px;\"><em>Childcare Available 10:00AM<br></em></span></h2><h2><br></h2><br><h3><span style=\"font-size:26px;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;​​​​​​​</span></h3><p><br></p>'),
(3, 'Home', 'Service Times (Mobile)', '1--1m', '<div style=\"text-align: center;\"><span style=\"font-size:26px;\"></span><p><span style=\"font-size:12px;\">Worship Service Times<br>8:30AM &amp; 10:00AM<br>Childcare Available at 10:00AM<br></span><br></p><br><br><div style=\"text-align:center\"><span style=\"font-size:24px;\"><em><br></em></span></div></div>'),
