(5, 'About', 'Our Beliefs', '3--3', '<div style=\"text-align: center;\"><span style=\"font-size:24px;\">We try to keep things simple<br><br></span></div><div><span style=\"font-size:16px;\"><strong>The Gospels record the following. exchange between Jesus and a man:​​​​​​​</strong></span><p>36 “Teacher, which is the greatest commandment in the Law?”</p><p>37 Jesus replied: “‘Love the Lord your God with all your heart and with all your soul and with all your mind.’ 38 This is the first and greatest commandment. 39 And the second is like it: ‘Love your neighbor as yourself.’ 40 All the Law and the Prophets hang on these two commandments.” Matthew 22:36-40</p><br><br><p>Love God, Love People – pretty straight forward. That’s what we believe and we believe that we are called to truly live it out day-by-day. Yes, we fail, often we fail! But the call stays the same, so when we fall it is easy to get back on track. Love God, Love People. We believe that when we do that we are Living the Good News that Jesus called us to live. That’s the call, that’s the journey, you’re welcome to join us. But if not here, connect somewhere. Why? We believe that the church, even though we at times mess up God’s beautiful design, is the hope of the world. And we believe that there is a church for you, whether it is here or somewhere else, we pray you find it.</p><br><p>You can dive-in further to what we believe, but every thing that follows, as Jesus said, hangs on the big two – Love God and Love People. For more detail use the links below.<br><br>Want further detail about what we believe and our affiliations? Click here:&nbsp;<a data-cke-saved-href=\"https://www.ecrossroads.net/about/beliefs-and-affiliations.php\" href=\"https://www.ecrossroads.net/about/beliefs-and-affiliations.php\">Beliefs and Affiliations</a><br><br>Interested in how we worship on Sundays? Click here:&nbsp;<a data-cke-saved-href=\"https://www.ecrossroads.net/connect/church_for_you.php\" href=\"https://www.ecrossroads.net/connect/church_for_you.php\">Is This the Church for You?</a><br></p><br></div>'),
(6, 'About', 'Our Ministries', '3--4', '<div style=\"text-align: center;\"><span style=\"font-size:24px;\">==CONNECT &amp; SERVE OPPORTUNITIES==</span><p style=\"text-align: left;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Enclosed is information and means of contact for the numerous Life Groups, Ministries, and Community Services that Crossroads Community Church and its attenders/members are involved in – and you’re invited to participate!</p><p style=\"text-align: left;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;If you’re interested in starting a Life Group or Ministry where you see a need in the church, please visit Pastor Joe to discuss. Not so much for “permission”, but to gain insight on how to start and what being a ministry leader looks like; along with confirming that the content aligns up to Crossroads’ vision as a Welcoming and Celebrating Group of Christ-followers.</p><span style=\"font-size:24px;\">==CHILDREN\'S MIINISTRY==<br></span><span style=\"font-size:16px;\"><strong>Leader: Shannon Waroway, #248-470-0156,&nbsp;<a data-cke-saved-href=\"mailto:shannon@ecrossroads.net\" href=\"mailto:shannon@ecrossroads.net\">shannon@ecrossroads.net</a></strong><br></span><br></div><table cellspacing=\"0\" cellpadding=\"0\" border=\"0\" style=\"width:100%\" class=\" cke_show_border\"><tbody><tr><td style=\"width:50%\"><h3 style=\"text-align: center;\"><strong><span style=\"font-size:16px;\">What many people think of children\'s ministry:</span></strong></h3></td><td><strong><span style=\"font-size:16px;\"><br></span></strong></td><td style=\"width:50%\"><h3 style=\"text-align: center;\"><strong><span style=\"font-size:16px;\">What children\'s ministry can be:</span></strong></h3></td></tr><tr><td><ul><li><span style=\"font-size:14px;\">A noisy place</span></li><li><span style=\"font-size:14px;\">Crowded spaces</span></li><li><span style=\"font-size:14px;\">Crying and whining toddlers</span></li><li><span style=\"font-size:14px;\">Hyperactive kids</span></li><li><span style=\"font-size:14px;\">Cleaning up messes</span></li><li><span style=\"font-size:14px;\">Wiping noses</span></li><li><span style=\"font-size:14px;\">Changing diapers</span></li><li><span style=\"font-size:14px;\">Making crafts</span></li><li><span style=\"font-size:14px;\">Serving snacks</span></li><li><span style=\"font-size:14px;\">Reading Bible stories</span></li><li><span style=\"font-size:14px;\">Dealing with unruly behavior</span></li><li><span style=\"font-size:14px;\">Cleaning up messes</span></li></ul></td><td><span style=\"font-size:14px;\"><br></span></td><td><ul><li><span style=\"font-size:14px;\">Encouraging</span></li><li><span style=\"font-size:14px;\">Entertaining</span></li><li><span style=\"font-size:14px;\">Profoundly spiritual at times</span></li><li><span style=\"font-size:14px;\">Tons of laughter</span></li><li><span style=\"font-size:14px;\">Meaningful even at the youngest ages</span></li><li><span style=\"font-size:14px;\">An opportunity to learn and be useful</span></li><li><span style=\"font-size:14px;\">A chance to make friends</span></li><li><span style=\"font-size:14px;\">A place to be loved, accepted &amp; celebrated</span></li><li><span style=\"font-size:14px;\">Where faith is nurtured</span></li><li><span style=\"font-size:14px;\">A place where kids feel they belong</span></li><li><span style=\"font-size:14px;\">Where kids grow spiritually</span></li><li><span style=\"font-size:14px;\">A place that is safe to be yourself</span></li><li><span style=\"font-size:14px;\">A place where you feel God\'s presence</span></li></ul></td></tr></tbody></table><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Volunteering in children’s ministry is an opportunity to be blessed in an unexpected way. Yes, wiping noses, changing diapers and cleaning up messes come with the territory. But the blessings far outweigh these things! We promise that if you engage in the lives of the children at this church, it will be time well-spent.<span style=\"font-size:24px;\"></span><br></p><p style=\"text-align: center;\"><span style=\"font-size:24px;\">==X-ROADS NATION==<br></span><strong><span style=\"font-size:16px;\">Leader: Ben McClain, #937-474-0178,&nbsp;<a data-cke-saved-href=\"mailto:thebenmcclain@gmail.com\" href=\"mailto:thebenmcclain@gmail.com\">thebenmcclain@gmail.com<br></a></span></strong></p><p><strong><span style=\"font-size:16px;\"><a data-cke-saved-href=\"mailto:thebenmcclain@gmail.com\" href=\"mailto:thebenmcclain@gmail.com\"></a></span></strong>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;We are a group of leaders helping middle- and high-school students find Jesus &amp; become better disciples of Him. How do we do this? We have “Aftershock” meetings three times a month where we play games, have small groups, and a Jesus-centered lesson. Once a month, we have a big event such as an amusement park, Paintball, &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Lock-in, MallTease Manhunt, &amp; many more. We are always in need of vehicles and drivers for these events!<strong><span style=\"font-size:16px;\"><a data-cke-saved-href=\"mailto:thebenmcclain@gmail.com\" href=\"mailto:thebenmcclain@gmail.com\"></a></span></strong><span style=\"font-size:24px;\"></span><br></p><p style=\"text-align: center;\"><span style=\"font-size:24px;\">==BIBLE STUDIES==</span><br></p><p style=\"text-align: center;\"><u><strong><span style=\"font-size:18px;\">Evening</span></strong></u><span style=\"font-size:24px;\"><br></span><strong><span style=\"font-size:16px;\">Contact: Sherry Scott, #734-968-2408,&nbsp;<a data-cke-saved-href=\"mailto:sherrysas6@gmail.com\" href=\"mailto:sherrysas6@gmail.com\">sherrysas6@gmail.com<br></a>Meets: 7PM, 2nd &amp; 4th Thursday of the month&nbsp; &nbsp; Location: Sherry\'s South Lyon home<br></span></strong></p><p><strong><span style=\"font-size:16px;\"></span></strong>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Reference books are used to assist us in our understanding of what God wants us to know. All are welcome to attend. We are currently in the book of 1 Samuel, about King David and how God takes us right where we are and can use us for His glory, and our benefit. There are many timeless lessons to learn, even today, in our own church life and our relationship with the Lord.<span style=\"font-size:24px;\"></span><br></p><p style=\"text-align: center;\"><span style=\"font-size:24px;\">==ACTIVE FAITH==<br></span><strong><span style=\"font-size:16px;\">Contact:&nbsp;<a data-cke-saved-href=\"http://www.activefaithcs.org\" href=\"http://www.activefaithcs.org\">http://www.activefaithcs.org</a>, #248-437-9790, Facebook<br></span></strong></p><p><strong><span style=\"font-size:16px;\"></span></strong>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Crossroads partners with other local churches in support of this community service provider. Active Faith provides food and clothing distribution, tutoring for grades K-5 with volunteers, utility/energy assistance and case management for each client by planning, seeking and monitoring services from different social agencies. The church has a hallway basket for donations of non-perishable food items, toiletries, baby and paper products; which are delivered to Active Faith bi-weekly.<span style=\"font-size:24px;\"></span><br></p><p style=\"text-align: center;\"><span style=\"font-size:24px;\">==ADMINISTRATIVE TEAM==<br></span><strong><span style=\"font-size:16px;\">Contact: Linda Chatel, #248-756-4284,&nbsp;<a data-cke-saved-href=\"mailto:linda@ecrossroads.net\" href=\"mailto:linda@ecrossroads.net\">linda@ecrossroads.net<br></a></span></strong></p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;This team of volunteers helps our Office Coordinator, Laura Podgorny, on an as needed basis with: special mailings, setting up for events, and general clerical work. We could also use additional helpers to serve as substitutes, assisting volunteers already in place, for sending the church’s informational e-mails and keeping the website’s calendar updated. To help offset office expenses, donations of postage stamps &amp; cases of copy paper are welcomed.<strong><span style=\"font-size:16px;\"><a data-cke-saved-href=\"mailto:linda@ecrossroads.net\" href=\"mailto:linda@ecrossroads.net\"></a></span></strong><span style=\"font-size:24px;\"></span><br></p><p style=\"text-align: center;\"><span style=\"font-size:24px;\">==ALOCHOLICS ANONYMOUS (A.A.)==<br></span></p><p><span style=\"font-size:24px;\"></span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Crossroads provides the facility for this community service. There are Tuesday evening meetings for men only at 7:30 PM and Saturdays at 8:00 PM, open to all.<span style=\"font-size:24px;\"></span><br></p><p style=\"text-align: center;\"><span style=\"font-size:24px;\">==A.A. BIG BOOK==<br></span><strong><span style=\"font-size:16px;\">Contact: Marli, #248-392-8006&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Location: Crossroads Church<br></span></strong></p><p><strong><span style=\"font-size:16px;\"></span></strong>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Crossroads provides the facility for this community service, with meetings in the church, unless there’s another function, then held in “The Garage”, on Sunday afternoons at 2:00 PM.​​​​​​​<span style=\"font-size:24px;\"></span><br></p><p style=\"text-align: center;\"><span style=\"font-size:24px;\">==AL-ANON==</span><br><span style=\"font-size:24px;\"></span><strong><span style=\"font-size:16px;\">Contact: Jennifer C., #248-321-9702<br>Meets: every Monday at 7:30PM&nbsp; &nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Location: Crossroads Church (The Garage)<br></span></strong></p><p><strong><span style=\"font-size:16px;\"></span></strong>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;In Al-Anon, members do not give direction or advice to other members. Instead, they share their personal experiences and stories, and invite other members to “take what they like and leave the rest”-that is, to determine for themselves what lesson they could apply to their own lives. Personal contact is an important element in the healing process. Al Anon members come to understand problem drinking as a family illness that affects everyone in the family. At Al Anon meetings, you can hear how they came to understand their own role in this family illness. This insight put them in a better position to play a positive role in the family’s future.</p><p style=\"text-align: center;\"><span style=\"font-size:24px;\"><br>==CAPERNUM HEALTH CLINIC==<br></span><strong><span style=\"font-size:16px;\">#248-225-4581,&nbsp;<a data-cke-saved-href=\"mailto:capernaumhealthclinic@gmail.com\" href=\"mailto:capernaumhealthclinic@gmail.com\">capernaumhealthclinic@gmail.com<br></a></span></strong></p><p><strong><span style=\"font-size:16px;\"><a data-cke-saved-href=\"mailto:capernaumhealthclinic@gmail.com\" href=\"mailto:capernaumhealthclinic@gmail.com\"></a></span></strong>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;This ministry provides FREE health care at quarterly events, locally, which include medical, dental, audiology, vision, mammograms, etc. through a coalition of South Lyon churches, including Crossroads, for those without adequate insurance or high deductibles/co-pays. If interested in participating as a volunteer, contact them to be put on their event invitation list.​​​​​​​<strong><span style=\"font-size:16px;\"><a data-cke-saved-href=\"mailto:capernaumhealthclinic@gmail.com\" href=\"mailto:capernaumhealthclinic@gmail.com\"></a></span></strong><span style=\"font-size:24px;\"></span><br></p><p style=\"text-align: center;\"><span style=\"font-size:24px;\">==CITY COVENANT COMMUNITY CARE==<br></span><strong><span style=\"font-size:16px;\">Contact: Sherry Scott, 734-968-2408 <span style=\"color:#2980b9;\"><u>sherrysas6</u></span><a data-cke-saved-href=\"mailto:bshoup811@gmail.com\" href=\"mailto:bshoup811@gmail.com\"><span style=\"color:#2980b9;\"><u>@</u>gmail.com</span><br></a></span></strong></p><p><strong><span style=\"font-size:16px;\"><a data-cke-saved-href=\"mailto:bshoup811@gmail.com\" href=\"mailto:bshoup811@gmail.com\"></a></span></strong>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Crossroads assists their sister church, City Covenant, at their Detroit Brightmoor location on the 1st Thursday of every month, by preparing and serving dinner to the neighborhood. Participation can range from purchasing to preparing a portion or full meal (for a very large group), to carpooling from Crossroads to help serve and clean up.​​​​​​​<strong><span style=\"font-size:16px;\"><a data-cke-saved-href=\"mailto:bshoup811@gmail.com\" href=\"mailto:bshoup811@gmail.com\"></a></span></strong><span style=\"font-size:24px;\"></span><br></p><p style=\"text-align: center;\"><span style=\"font-size:24px;\">==COFFEE TEAM==<br></span><strong><span style=\"font-size:16px;\">Contact: Laura Podgorny, #248-756-8937,&nbsp;<a data-cke-saved-href=\"mailto:laura@ecrossroads.net\" href=\"mailto:laura@ecrossroads.net\">laura@ecrossroads.net<br></a></span></strong></p><p><strong><span style=\"font-size:16px;\"><a data-cke-saved-href=\"mailto:laura@ecrossroads.net\" href=\"mailto:laura@ecrossroads.net\"></a></span></strong>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;There’s something welcoming about a hot cup of coffee or tea to a first-time visitor, especially when served by a smiling face! Regular attenders really look forward to getting their morning java too. It’s one of those “behind-the-scenes” ministries that, if it weren’t there, it would truly be missed. More folks are needed to prepare, refill, clean up or even purchase supplies. We welcome donations of cups, (matching) lids, sugar packets, stirrers, tea bags, creamer cups or just cash to help offset the cost to the church. Time commitment is no more than 4 hours on any given Sunday, and you can enjoy the worship service during your shift.<strong><span style=\"font-size:16px;\"><a data-cke-saved-href=\"mailto:laura@ecrossroads.net\" href=\"mailto:laura@ecrossroads.net\"></a></span></strong><span style=\"font-size:24px;\"></span><br></p><p style=\"text-align: center;\"><span style=\"font-size:24px;\">==CONNECTION TEAM (GREETERS, ANNOUNCERS, AND COMMUNION)==<br></span><strong><span style=\"font-size:16px;\">Contact: JoAnne Muzzi, #248-345-6784,&nbsp;<a data-cke-saved-href=\"mailto:joanne_ickes@yahoo.com\" href=\"mailto:joanne_ickes@yahoo.com\">joanne_ickes@yahoo.com<br></a></span></strong></p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;The Connection Team consists of those who help by passing out programs and hanging out at the Welcome Table/serving the Communion elements/etc., i.e., that is, helping people get connected at Crossroads!</p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;However, ALL OF US who call Crossroads our home church are really on the Connection Team – because we all have the honor of making church warm and inviting by making a special attempt each week to meet someone new or make someone feel welcomed!</p><p style=\"text-align: center;\"><span style=\"font-size:24px;\">==DRAMA TEAM==<br></span><strong><span style=\"font-size:16px;\">Contact: Pastor Dave Chatel, #248-756-4283,&nbsp;<a data-cke-saved-href=\"mailto:dave@ecrossroads.net\" href=\"mailto:dave@ecrossroads.net\">dave@ecrossroads.net<br></a></span></strong></p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;The drama team puts on an annual Dessert Theater that is a fundraiser for Renewed Hope Counseling Center. Also, for Christmas, Good Friday and Easter the troupe performs plays or readings. When these performances are scheduled, we will hold auditions where parts are cast and rehearsals are planned out. New talent is always accepted. Also, part of drama production includes prop people, stage help, tech &amp; lighting help, and décor help. If you have interest in assisting in these areas, please let us know!</p><p style=\"text-align: center;\"><strong><span style=\"font-size:16px;\"><a data-cke-saved-href=\"mailto:dave@ecrossroads.net\" href=\"mailto:dave@ecrossroads.net\"></a></span></strong><span style=\"font-size:24px;\"><br>==TECH TEAM==<br></span><strong><span style=\"font-size:16px;\">Contact: Jen Niemi,&nbsp;<a data-cke-saved-href=\"mailto:jen@ecrossroads.net\" href=\"mailto:jen@ecrossroads.net\">jen@ecrossroads.net</a></span></strong><span style=\"font-size:24px;\"><a data-cke-saved-href=\"mailto:jen@ecrossroads.net\" href=\"mailto:jen@ecrossroads.net\"><br></a></span><u><strong><span style=\"font-size:18px;\">Slides / Lights<br></span></strong></u></p><p><u><strong><span style=\"font-size:18px;\"></span></strong></u>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Person to be on a 1x/month rotation for slides/lights. No experience necessary, but must be willing to be at all three services (although special arrangements can be made if that’s not possible).​​​​​​​<u><strong><span style=\"font-size:18px;\"></span></strong></u><br></p><p style=\"text-align: center;\"><u><strong><span style=\"font-size:18px;\">Sound Board Technician<br></span></strong></u></p><p><u><strong><span style=\"font-size:18px;\"></span></strong></u>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Must have an ear for music. Some training required, and we’re looking for someone to come in approximately 1x/month, for both services.<u><strong><span style=\"font-size:18px;\"></span></strong></u><br></p><p style=\"text-align: center;\"><u><strong><span style=\"font-size:18px;\">Video Technician<br></span></strong></u></p><p><u><strong><span style=\"font-size:18px;\"></span></strong></u>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;One person to record the messages… last service only. No experience necessary.<span style=\"font-size:24px;\"></span><br></p><p style=\"text-align: center;\"><span style=\"font-size:24px;\">==WORSHIP TEAM==<br></span><strong><span style=\"font-size:16px;\">Contact:&nbsp;Jen Niemi,&nbsp;<a data-cke-saved-href=\"mailto:jen@ecrossroads.net\" href=\"mailto:jen@ecrossroads.net\">jen@ecrossroads.net<br></a></span></strong></p><p><strong><span style=\"font-size:16px;\"><a data-cke-saved-href=\"mailto:jen@ecrossroads.net\" href=\"mailto:jen@ecrossroads.net\"></a></span></strong>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;The music ministry meets on a regular basis to connect as a team, and rehearse for Sunday\'s music and the occasional Worship Night. The style ranges from acoustic to a full band. If interested in being part of the team for the following areas, contact Jen to schedule an audition. TALENTED MUSICIANS: Experience necessary, for guitar/bass/keys. VOCALISTS FOR ENSEMBLE/CHOIR: Once a month &amp; on a per-request basis for the holidays (a sign-up sheet will be put out for special events) and an audition may be scheduled.​​​​​​​<strong><span style=\"font-size:16px;\"><a data-cke-saved-href=\"mailto:jen@ecrossroads.net\" href=\"mailto:jen@ecrossroads.net\"></a></span></strong><span style=\"font-size:24px;\"></span><br></p><p style=\"text-align: center;\"><span style=\"font-size:24px;\">==YOGA &amp; TAICHI CLASS==<br></span><strong><span style=\"font-size:16px;\">Contact: Dave Dixson,&nbsp;<a data-cke-saved-href=\"mailto:dmdixson@hotmail.com\" href=\"mailto:dmdixson@hotmail.com\">dmdixson@hotmail.com<br></a></span></strong></p><p><strong><span style=\"font-size:16px;\"><a data-cke-saved-href=\"mailto:dmdixson@hotmail.com\" href=\"mailto:dmdixson@hotmail.com\"></a></span></strong>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Our own Dave Dixson is a Sifu Master and hosts this class every Saturday from 9:00-10:00 AM. All skill levels are welcome; the 1st half hour is dedicated to yoga, with the 2nd half focusing on TaiChi movements. Bring a mat and wear comfortable clothing; suggested cost is $5.<strong><span style=\"font-size:16px;\"><a data-cke-saved-href=\"mailto:dmdixson@hotmail.com\" href=\"mailto:dmdixson@hotmail.com\"></a></span></strong><span style=\"font-size:24px;\"></span><strong><span style=\"font-size:16px;\"></span></strong><strong><span style=\"font-size:16px;\"></span></strong>&nbsp; &nbsp;<br></p><p style=\"text-align: center;\"><span style=\"font-size:24px;\">==FORGOTTEN MAN MINISTRIES==<br></span><strong><span style=\"font-size:16px;\">Contact: Terry Rybak, #517-376-0455,&nbsp;<a data-cke-saved-href=\"mailto:trybak@tir.com\" href=\"mailto:trybak@tir.com\">trybak@tir.com<br></a>Contact: Marge Raymond, #614-205-3700,&nbsp;<a data-cke-saved-href=\"mailto:margeraymontd@hotmail.com\" href=\"mailto:margeraymontd@hotmail.com\">margeraymontd@hotmail.com<br></a></span></strong></p><p><strong><span style=\"font-size:16px;\"><a data-cke-saved-href=\"mailto:margeraymontd@hotmail.com\" href=\"mailto:margeraymontd@hotmail.com\"></a></span></strong>Providing evangelism and discipleship among inmates in 35 Michigan jails, Forgotten Man Ministries serves as the hand of the Lord inside jails and bring together inmates, chaplains, and lay-workers in the ministry of God’s Word, with a goal of rehabilitation in the name of Jesus Christ. There is an informative (free, with a goodwill offering taken) Annual Banquet, held locally, in November for anyone interested in learning more / hearing testimonies / speak to representatives / etc. For ways to be involved, contact Terry or Marge or visit:&nbsp;<a data-cke-saved-href=\"https://www.ecrossroads.net/about/www.forgottenman.org\" href=\"https://www.ecrossroads.net/about/www.forgottenman.org\">www.forgottenman.org</a><strong><span style=\"font-size:16px;\"><a data-cke-saved-href=\"mailto:margeraymontd@hotmail.com\" href=\"mailto:margeraymontd@hotmail.com\"></a></span></strong><span style=\"font-size:24px;\"><br></span></p><p style=\"text-align: center;\"><strong><span style=\"font-size:16px;\"></span></strong><br></p><p style=\"text-align: center;\"><span style=\"font-size:24px;\">==GIVING 360==<br></span><strong><span style=\"font-size:16px;\">Contacts: Dan &amp; Brenda Weiland, #248-755-1826<br></span></strong></p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Giving 360 is a ministry that connects to local retailers of house goods and home improvement merchandise. With the help of volunteers, they pick up and sort through these large donations on a weekly basis to find what is usable. These items are then given away for free to ease the financial burden of life. The program helps people in need and is also a resource for people to save money. You can then take that money saved and put it toward other things, like your Church or your family, for example.</p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;If you would like to help someone in need, look for somethings that would help ease your financial burden, or just to come visit and check it out, then call or text Dan @ (248)755-1826 to set up an appointment.</p><p style=\"text-align: center;\"><span style=\"font-size:24px;\"><br>==HOPE NOT HANDCUFFS==<br></span><strong><span style=\"font-size:16px;\">Contact: Pam Blair, #248-505-7904<br></span></strong></p><p><strong><span style=\"font-size:16px;\"></span></strong>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;This ministry is a local initiative to bring law enforcement and community organizations together in an effort to find viable treatment options to reduce dependency on drugs and alcohol. Trained “Angels” meet with those seeking help at participating police agencies to offer support, respect and compassion; and provide a brief intake process for proper treatment placement. For more info., visit&nbsp;<a data-cke-saved-href=\"https://www.ecrossroads.net/about/www.familiesagainstnarcotics.org\" href=\"https://www.ecrossroads.net/about/www.familiesagainstnarcotics.org\">www.familiesagainstnarcotics.org</a>&nbsp;or email:&nbsp;<a data-cke-saved-href=\"mailto:oakland@hopenothandcuffs.com\" href=\"mailto:oakland@hopenothandcuffs.com\">oakland@hopenothandcuffs.com</a><span style=\"font-size:24px;\"></span><br></p><p style=\"text-align: center;\"><br></p><p style=\"text-align: center;\"><br></p><span style=\"font-size:24px;\"></span>'),
(7, 'Connect', 'Join Us in Person', '2--1', '<p style=\"text-align: center;\"><span style=\"font-size:26px;\"><br>Ready to come to live, in-person worship?</span></p><p style=\"text-align: center;\"><em><span style=\"font-size:20px;\">Join us for a one hour worship service</span></em><strong><span style=\"font-size:10px;\"><br></span><span style=\"font-size:26px;\">10:00AM</span></strong><strong><span style=\"font-size:20px;\"></span></strong><span style=\"font-size:26px;\"></span><br></p><strong><span style=\"font-size:26px;\"></span></strong><p style=\"text-align:center\"><span style=\"font-size:24px\">We believe in holding worship gatherings that are <br>Christ-centered, relevant and real. So...</span></p><ul><li><span style=\"font-size:18px;\">We teach with a solid biblical foundation always asking the question: how does this apply to my life TODAY?</span></li><li><span style=\"font-size:18px;\">We sing contemporary worship songs and updated classics</span></li><li><span style=\"font-size:18px;\">We laugh often; God has given us a life of joy to be celebrated, not hidden</span></li><li><span style=\"font-size:18px;\">We support children, youth &amp; families through quality programs because we want to see families thrive</span></li><li><span style=\"font-size:18px;\">We reach out to our community - to EVERYONE in the community, to spread the Good News</span></li><li><span style=\"font-size:18px;\">We take discipleship seriously, always asking the question: how is God growing us as a church and as individuals?</span></li></ul><p style=\"text-align:center\"><span style=\"font-size:24px\">WE ARE a group of Christians following a simple plan to</span></p><p style=\"text-align:center\"><span style=\"font-size:20px;\"><strong>Love God, Love People, and Live the Good News</strong></span></p><p style=\"text-align: center;\"><span style=\"font-size:18px;\">You are welcome to join us on the journey​​​​​​​.</span><br></p>'),
(8, 'Connect', 'Join Us Online', '2--2', '<p style=\"text-align: center;\"><span style=\"font-size:24px;\"><br>Join us virtually or in person on Sunday mornings at <strong>10am</strong></span><span style=\"font-size:12px;\"><br>​​​​​​​</span><span style=\"font-size:24px;\">or watch the worship service anytime on demand.<br><br></span><span style=\"font-size:20px;\">Find live and recorded worship services here:</span><span style=\"font-size:24px;\"><br><br></span><span style=\"font-size:20px;\"><a data-cke-saved-href=\"https://www.youtube.com/channel/UC-7Dz_1bSsOMvsWebqxYypA/featured\" href=\"https://www.youtube.com/channel/UC-7Dz_1bSsOMvsWebqxYypA/featured\">Crossroads YouTube Page<br></a></span><a data-cke-saved-href=\"https://www.facebook.com/crossroadschurchofsouthlyon\" href=\"https://www.facebook.com/crossroadschurchofsouthlyon\"><span style=\"font-size:20px;\">Crossroads Public Facebook Page</span></a><br></p>'),
(9, 'Connect', 'I\'m New', '2--3', '<span style=\"font-size:22px;\"></span><p style=\"text-align: center;\"><span style=\"font-size: 24px;\"></span>Thanks for visiting the Crossroads website, we are a simple church following Jesus’ simple plan to Love God and Love people. Use the website to check out who we are and if it feels like a fit for you, we hope you will join us on a Sunday morning for worship.</p><span style=\"font-size:14px\"></span>'),
(10, 'Connect', 'Connect With Us', '2--4', '<p>This page is currently under construction BUT for more information about Crossroads simply email <strong>info@ecrossroads.net</strong></p>'),
(11, 'Connect', 'Is This the Church for You?', '2--5', '<p><span style=\"font-size:18px;\"></span>That depends, of course. There are many different types of churches and that is a good thing! Here’s who we are-if it fits who God has called you to be, and you are looking for a church, then feel free to join us at one of our worship services. If we don’t sound like a fit for you, we pray your search is successful and feel free to drop in any time to say hello.<br></p><p style=\"text-align: center;\"><span style=\"font-size:24px;\">Who We Are</span><br></p><p>At Crossroads we seek to be true to our calling as disciples of Christ. We pray, take communion, learn and fellowship regularly. (Acts 2:42) AND we allow ourselves to laugh or cry or be amazed by the power of the living God working in our midst.<br></p><p>(Psalm 46:10)<br></p><p><br></p><p>We believe that God is working in the world and our church. We see God’s power in the healing of broken relationships, people growing as disciples, addictions being overcome, lives truly being saved. We rejoice over God’s work in the past and eagerly anticipate God’s continuous work in our midst.<br></p><p><br></p><p style=\"text-align: center;\"><span style=\"font-size:24px;\">We believe God has called us to be .. us! We ask simply:</span><br></p><p><span style=\"font-size:24px;\"></span><span style=\"font-size:18px;\"></span>How has God uniquely shaped our church community to reach the wider community?<br></p><p style=\"text-align: center;\"><span style=\"font-size:24px;\">We believe that we are true to our calling by being in prayer individually and communally and by holding worship gatherings that are Christ-centered, relevand and real. So...</span><br></p><ul><li><span style=\"font-size:14px;\">We teach with a solid biblical foundation always asking the question: how does this apply to my life TODAY?<br></span></li><li><span style=\"font-size:14px;\">We sing contemporary worship songs and updated classics<br></span></li><li><span style=\"font-size:14px;\">We laugh often; God has given us a life of joy to be celebrated, not hidden<br></span></li><li><span style=\"font-size:14px;\">We support children, youth &amp; families through quality programs because we want to see families thrive</span><br></li><li><span style=\"font-size: 14px;\">We reach out to our community - to EVERYONE in the community, to spread the Good News</span></li><li><span style=\"font-size: 14px;\">We take discipleship seriously, always asking the question: how is God growing us as a church and as individuals?</span><span style=\"font-size: 14px;\"></span></li></ul><p style=\"text-align: center;\"><span style=\"font-size:24px;\">WE ARE a group of Christians following a simple plan to</span><br></p><p style=\"text-align: center;\"><span style=\"font-size:14px;\">Love God, Love People, and Live the Good News</span><br></p><p style=\"text-align: center;\"><span style=\"font-size: 14px;\">You are welcome to join us on the journey</span></p>'),
(12, 'Connect', 'Children\'s Ministry', '2--6', '<p style=\"text-align: center;\"><span style=\"font-size:24px;\">Currently Meets During 10am Worship Service<br><br></span><span style=\"font-size:14px;\">We are looking for volunteers to help assist! If you are interesting in volunteering your time please contact us at info@ecrossroads.net <br>​​​​​​​(no experience is needed)<br></span><span style=\"font-size:24px;\"></span><span style=\"font-size:24px;\"></span><br><span style=\"color:#ffffff;\"><span style=\"font-size:11pt\"><span style=\"font-family:Arial\"><strong>Sunday Mornings</strong></span></span></span></p><p><span style=\"color:#ffffff;\"><span style=\"font-size:11pt\"><span style=\"font-family:Arial\">On Sunday mornings you can expect a safe, loving environment that is full of fun and learning. Nursery-5 begin the worship service in their classroom. The preschoolers receive a fun, age-appropriate lesson and get a chance to play. Elementary age children start the day with their parents and are released to their teachers about 10 minutes into the worship service.</span></span></span></p><span style=\"color:#ffffff;\"><br></span><p style=\"text-align:center\"><span style=\"color:#ffffff;\"><span style=\"font-size:11pt\"><span style=\"font-family:Arial\"><strong>Beyond Sunday</strong></span></span></span></p><p><span style=\"color:#ffffff;\"><span style=\"font-size:11pt\"><span style=\"font-family:Arial\">Crossroads Children’s Ministry is active beyond Sunday mornings with movie nights, Harvest Party, Fall Party, Easter Egg Hunt, and the highlight of the year for all children at Crossroads: Vacation Bible Study. All events are full of love and fun.</span></span></span></p><p><strong>Want to serve?</strong></p><table cellspacing=\"0\" cellpadding=\"0\" border=\"0\" style=\"width:100%\" class=\" cke_show_border\"><tbody><tr><td style=\"width:50%\"><h3><span style=\"font-size:20px;\"><strong></strong></span><span style=\"font-size:20px;\"><strong>What many people think of childrens ministry...</strong></span><br></h3></td><td><br></td><td style=\"width:50%\"><h3><span style=\"font-size:20px;\"><b>What children\'s ministry can be...</b></span></h3></td></tr><tr><td><ul><li>A noisy place</li><li>Crowded spaces</li><li>Crying and whining toddlers</li><li>Hyperactive kids</li><li>Cleaning up messes</li><li>Wiping noses</li><li>Changing diapers</li><li>Making crafts</li><li>Serving snacks</li><li>Reading bible stories</li><li>Dealing with unruly behavior</li><li>Cleaning up more messes</li></ul></td><td><br></td><td><ul><li>Encouraging</li><li>Entertaining</li><li>Profoundly spirtiual at times</li><li>Meaningful even at the youngest ages</li><li>An opportunity to learn and be useful</li><li>A chance to make friends</li><li>A place to be loved, accepted &amp; celebrated</li><li>Where faith is nurtured</li><li>A place where kids feel they beloong</li><li>Where kids grow spiritually</li><li>A place that is safe to be yourself</li><li>A place where you will feel God\'s presence</li></ul></td></tr></tbody></table><p>Volunteering in children’s ministry is an opportunity to be blessed in an unexpected way. Yes, wiping noses, and cleaning up messes come with the territory. But the blessings far outweigh these things! We promise that if you engage in the lives of the children at Crossroads, it will be time well-spent. If you have read this far and are interested in volunteering, please fill out the background check form that is attached below and turn it in to the church office.<br></p>');
INSERT INTO `content_management` (`id`, `section`, `name`, `slug`, `content`) VALUES
(13, 'Connect', 'Serve', '2--7', '<div style=\"text-align:center\"><span style=\"font-size:24px\">==CONNECT &amp; SERVE OPPORTUNITIES==</span><p style=\"text-align:left\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Enclosed is information and means of contact for the numerous Ministries and Community Services that Crossroads Community Church and its attenders/members are involved in – and you’re invited to participate!</p><p style=\"text-align:left\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;If you’re interested in starting a Life Group or Ministry where you see a need in the church, please contact Pastor Joe at joe@ecrossroads.net. Not so much for “permission”, but to gain insight on how to start and what being a ministry leader looks like; along with confirming that the content aligns up to Crossroads’ vision as a Welcoming and Celebrating Group of Christ-followers.</p><span style=\"font-size:24px\">==CHILDREN\'S MINISTRY==</span><br><span style=\"font-size:16px\"><strong>Leader: Shannon Waroway, #248-470-0156, <span style=\"color:#2980b9;\">swaroway@gmail.com</span></strong><strong></strong></span><br><br></div><table cellspacing=\"0\" cellpadding=\"0\" border=\"0\" style=\"width:100%\" class=\" cke_show_border\"><tbody><tr><td style=\"width:50%\"><h3 style=\"text-align:center\"><strong><span style=\"font-size:16px\">What many people think of children\'s ministry:</span></strong></h3></td><td><br></td><td style=\"width:50%\"><h3 style=\"text-align:center\"><strong><span style=\"font-size:16px\">What children\'s ministry can be:</span></strong></h3></td></tr><tr><td><ul><li><span style=\"font-size:14px\">A noisy place</span></li><li><span style=\"font-size:14px\">Crowded spaces</span></li><li><span style=\"font-size:14px\">Crying and whining toddlers</span></li><li><span style=\"font-size:14px\">Hyperactive kids</span></li><li><span style=\"font-size:14px\">Cleaning up messes</span></li><li><span style=\"font-size:14px\">Wiping noses</span></li><li><span style=\"font-size:14px\">Changing diapers</span></li><li><span style=\"font-size:14px\">Making crafts</span></li><li><span style=\"font-size:14px\">Serving snacks</span></li><li><span style=\"font-size:14px\">Reading Bible stories</span></li><li><span style=\"font-size:14px\">Dealing with unruly behavior</span></li><li><span style=\"font-size:14px\">Cleaning up messes</span></li></ul></td><td><br></td><td><ul><li><span style=\"font-size:14px\">Encouraging</span></li><li><span style=\"font-size:14px\">Entertaining</span></li><li><span style=\"font-size:14px\">Profoundly spiritual at times</span></li><li><span style=\"font-size:14px\">Tons of laughter</span></li><li><span style=\"font-size:14px\">Meaningful even at the youngest ages</span></li><li><span style=\"font-size:14px\">An opportunity to learn and be useful</span></li><li><span style=\"font-size:14px\">A chance to make friends</span></li><li><span style=\"font-size:14px\">A place to be loved, accepted &amp; celebrated</span></li><li><span style=\"font-size:14px\">Where faith is nurtured</span></li><li><span style=\"font-size:14px\">A place where kids feel they belong</span></li><li><span style=\"font-size:14px\">Where kids grow spiritually</span></li><li><span style=\"font-size:14px\">A place that is safe to be yourself</span></li><li><span style=\"font-size:14px\">A place where you feel God\'s presence</span></li></ul></td></tr></tbody></table><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Volunteering in children’s ministry is an opportunity to be blessed in an unexpected way. Yes, wiping noses, changing diapers and cleaning up messes come with the territory. But the blessings far outweigh these things! We promise that if you engage in the lives of the children at this church, it will be time well-spent.</p><p style=\"text-align:center\"><span style=\"font-size:24px\">==X-ROADS NATION==</span><br><strong><span style=\"font-size:16px\">Leader: Ben McClain, #937-474-0178,&nbsp;thebenmcclain@gmail.com</span></strong></p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;We are a group of leaders helping middle- and high-school students find Jesus &amp; become better disciples of Him. How do we do this? We have “Aftershock” meetings three times a month where we play games, have small groups, and a Jesus-centered lesson. Once a month, we have a big event such as an amusement park, Paintball, &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Lock-in, MallTease Manhunt, &amp; many more. We are always in need of vehicles and drivers for these events!</p><p style=\"text-align:center\">&nbsp; &nbsp; &nbsp; &nbsp;</p><p style=\"text-align:center\"><span style=\"font-size:24px\">==ACTIVE FAITH==</span><br><strong><span style=\"font-size:16px\">Contact:&nbsp;<a data-cke-saved-href=\"http://www.activefaithcs.org\" href=\"http://www.activefaithcs.org\">http://www.activefaithcs.org</a>, #248-437-9790, Facebook</span></strong></p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Crossroads partners with other local churches in support of this community service provider. Active Faith provides food and clothing distribution, tutoring for grades K-5 with volunteers, utility/energy assistance and case management for each client by planning, seeking and monitoring services from different social agencies. The church has a hallway basket for donations of non-perishable food items, toiletries, baby and paper products; which are delivered to Active Faith bi-weekly.</p><p style=\"text-align:center\"><span style=\"font-size:24px\">==ADMINISTRATIVE TEAM==</span><br><strong><span style=\"font-size:16px\">Contact: Linda Chatel, #248-756-4284,&nbsp;linda@ecrossroads.net</span></strong></p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;This team of volunteers helps our Office Coordinator, Laura Podgorny, on an as needed basis with: special mailings, setting up for events, and general clerical work. We could also use additional helpers to serve as substitutes, assisting volunteers already in place, for sending the church’s informational e-mails and keeping the website’s calendar updated. To help offset office expenses, donations of postage stamps &amp; cases of copy paper are welcomed.</p><p style=\"text-align:center\"><span style=\"font-size:24px\">==ALOCHOLICS ANONYMOUS (A.A.)==</span></p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Crossroads provides the facility for this community service, Saturdays at 8:00 PM, open to all.</p><p style=\"text-align:center\"><span style=\"font-size:24px\">==A.A. BIG BOOK==</span><br><strong><span style=\"font-size:16px\">Contact: Marli, #248-392-8006&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Location: Crossroads Church</span></strong></p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Crossroads provides the facility for this community service, with meetings in the church, unless there’s another function, then held in “The Garage”, on Sunday afternoons at 2:00 PM.​​​​​​​</p><p style=\"text-align:center\"><span style=\"font-size:24px\">==AL-ANON==</span><br><strong><span style=\"font-size:16px\">Contact: Jennifer C., #248-321-9702<br>Meets: every Monday at 7:30PM&nbsp; &nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Location: Crossroads Church (The Garage)</span></strong></p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;In Al-Anon, members do not give direction or advice to other members. Instead, they share their personal experiences and stories, and invite other members to “take what they like and leave the rest”-that is, to determine for themselves what lesson they could apply to their own lives. Personal contact is an important element in the healing process. Al Anon members come to understand problem drinking as a family illness that affects everyone in the family. At Al Anon meetings, you can hear how they came to understand their own role in this family illness. This insight put them in a better position to play a positive role in the family’s future.</p><p style=\"text-align:center\"><br><span style=\"font-size:24px\">==CAPERNUM HEALTH CLINIC==</span><br><strong><span style=\"font-size:16px\">#248-225-4581,&nbsp;<a data-cke-saved-href=\"mailto:capernaumhealthclinic@gmail.com\" href=\"mailto:capernaumhealthclinic@gmail.com\">capernaumhealthclinic@gmail.com</a></span></strong></p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;This ministry provides FREE health care at quarterly events, locally, which include medical, dental, audiology, vision, mammograms, etc. through a coalition of South Lyon churches, including Crossroads, for those without adequate insurance or high deductibles/co-pays. If interested in participating as a volunteer, contact them to be put on their event invitation list.​​​​​​​</p><p style=\"text-align:center\"><span style=\"font-size:24px\"><u></u>==CITY COVENANT COMMUNITY CARE==</span><br><strong><span style=\"font-size:16px\">Contact: Sherry Scott, 734-968-2408 <span style=\"color:#2980b9\">sherrysas6@gmail.com</span></span></strong></p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Crossroads assists their sister church, City Covenant, at their Detroit Brightmoor location on the 1st Thursday of every month, by preparing and serving dinner to the neighborhood. Participation can range from purchasing to preparing a portion or full meal (for a very large group), to carpooling from Crossroads to help serve and clean up.​​​​​​​</p><p style=\"text-align:center\"><span style=\"font-size:24px\">==COFFEE TEAM==</span><br><strong><span style=\"font-size:16px\">Contact: Laura Podgorny, #248-756-8937,&nbsp;<span style=\"color:#2980b9;\">laurapodgorny@yahoo.com</span></span></strong></p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;There’s something welcoming about a hot cup of coffee or tea to a first-time visitor, especially when served by a smiling face! Regular attenders really look forward to getting their morning java too. It’s one of those “behind-the-scenes” ministries that, if it weren’t there, it would truly be missed. More folks are needed to prepare, refill, clean up or even purchase supplies. We welcome donations of cups, (matching) lids, sugar packets, stirrers, tea bags, creamer cups or just cash to help offset the cost to the church. Time commitment is no more than 4 hours on any given Sunday, and you can enjoy the worship service during your shift.</p><p style=\"text-align:center\"><span style=\"font-size:24px\">==CONNECTION TEAM (GREETERS, ANNOUNCERS, AND COMMUNION)==</span><br><strong><span style=\"font-size:16px\">Contact: JoAnne Muzzi, #248-345-6784,&nbsp;<span style=\"color:#2980b9;\">joanne_ickes@yahoo.com</span></span></strong></p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;The Connection Team consists of those who help by passing out programs and hanging out at the Welcome Table/serving the Communion elements/etc., i.e., that is, helping people get connected at Crossroads!</p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;However, ALL OF US who call Crossroads our home church are really on the Connection Team – because we all have the honor of making church warm and inviting by making a special attempt each week to meet someone new or make someone feel welcomed!</p><p style=\"text-align:center\"><span style=\"font-size:24px\">==DRAMA TEAM==</span><br><strong><span style=\"font-size:16px\">Contact: Pastor Dave Chatel, #248-756-4283,<span style=\"color:#2980b9;\">&nbsp;dchatsky1@gmail.com</span><span style=\"color:#2980b9;\"></span></span></strong></p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;The drama team puts on an annual Dessert Theater that is a fundraiser for Renewed Hope Counseling Center. Also, for Christmas, Good Friday and Easter the troupe performs plays or readings. When these performances are scheduled, we will hold auditions where parts are cast and rehearsals are planned out. New talent is always accepted. Also, part of drama production includes prop people, stage help, tech &amp; lighting help, and décor help. If you have interest in assisting in these areas, please let us know!</p><p style=\"text-align:center\"><br><span style=\"font-size:24px\">==TECH TEAM==</span><br><strong><span style=\"font-size:16px\">Contact: Jen Niemi,&nbsp;<span style=\"color:#2980b9;\">jenniferniemi23@gmail.com</span></span></strong><br><u><strong><span style=\"font-size:18px\">Slides / Lights</span></strong></u></p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Person to be on a 1x/month rotation for slides/lights. No experience necessary, but must be willing to be at all three services (although special arrangements can be made if that’s not possible).​​​​​​​</p><p style=\"text-align:center\"><u><strong><span style=\"font-size:18px\">Sound Board Technician</span></strong></u></p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Must have an ear for music. Some training required, and we’re looking for someone to come in approximately 1x/month, for both services.</p><p style=\"text-align:center\"><u><strong><span style=\"font-size:18px\">Video Technician</span></strong></u></p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;One person to record the messages… last service only. No experience necessary.</p><p style=\"text-align:center\"><span style=\"font-size:24px\">==WORSHIP TEAM==</span><br><strong><span style=\"font-size:16px\">Contact:&nbsp;Jen Niemi,&nbsp;<span style=\"color:#2980b9;\">jenniferniemi23@gmail.com</span><a data-cke-saved-href=\"mailto:jen@ecrossroads.net\" href=\"mailto:jen@ecrossroads.net\"></a></span></strong></p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;The music ministry meets on a regular basis to connect as a team, and rehearse for Sunday\'s music and the occasional Worship Night. The style ranges from acoustic to a full band. If interested in being part of the team for the following areas, contact Jen to schedule an audition. TALENTED MUSICIANS: Experience necessary, for guitar/bass/keys. VOCALISTS FOR ENSEMBLE/CHOIR: Once a month &amp; on a per-request basis for the holidays (a sign-up sheet will be put out for special events) and an audition may be scheduled.​​​​​​​<br></p><p style=\"text-align:center\"><span style=\"font-size:24px\">==FORGOTTEN MAN MINISTRIES==</span><br><strong><span style=\"font-size:16px\">Contact: Terry Rybak, #517-376-0455,&nbsp;<a data-cke-saved-href=\"mailto:trybak@tir.com\" href=\"mailto:trybak@tir.com\">trybak@tir.com</a><br>Contact: Marge Raymond, #614-205-3700,&nbsp;<a data-cke-saved-href=\"mailto:margeraymontd@hotmail.com\" href=\"mailto:margeraymontd@hotmail.com\">margeraymontd@hotmail.com</a></span></strong></p><p>Providing evangelism and discipleship among inmates in 35 Michigan jails, Forgotten Man Ministries serves as the hand of the Lord inside jails and bring together inmates, chaplains, and lay-workers in the ministry of God’s Word, with a goal of rehabilitation in the name of Jesus Christ. There is an informative (free, with a goodwill offering taken) Annual Banquet, held locally, in November for anyone interested in learning more / hearing testimonies / speak to representatives / etc. For ways to be involved, contact Terry or Marge or visit:&nbsp;<a data-cke-saved-href=\"https://www.ecrossroads.net/about/www.forgottenman.org\" href=\"https://www.ecrossroads.net/about/www.forgottenman.org\">www.forgottenman.org</a></p><p style=\"text-align:center\"><br></p><p style=\"text-align:center\"><span style=\"font-size:24px\">==GIVING 360==</span><br><strong><span style=\"font-size:16px\">Contact: Cara Linville 248-756-4833 (text only please)</span></strong></p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Giving 360 is a ministry that connects to local retailers of house goods and home improvement merchandise. With the help of volunteers, they pick up and sort through these large donations on a weekly basis to find what is usable. These items are then given away for free to ease the financial burden of life. The program helps people in need and is also a resource for people to save money. You can then take that money saved and put it toward other things, like your Church or your family, for example.</p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;If you would like to help someone in need, look for somethings that would help ease your financial burden, or just to come visit and check it out, then text Cara @ (248)756-4833 to set up an appointment.</p><p style=\"text-align:center\"><br><span style=\"font-size:24px\">==HOPE NOT HANDCUFFS==</span><br><strong><span style=\"font-size:16px\">Contact: Pam Blair, #248-505-7904</span></strong></p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;This ministry is a local initiative to bring law enforcement and community organizations together in an effort to find viable treatment options to reduce dependency on drugs and alcohol. Trained “Angels” meet with those seeking help at participating police agencies to offer support, respect and compassion; and provide a brief intake process for proper treatment placement. For more info., visit&nbsp;<a data-cke-saved-href=\"https://www.ecrossroads.net/about/www.familiesagainstnarcotics.org\" href=\"https://www.ecrossroads.net/about/www.familiesagainstnarcotics.org\">www.familiesagainstnarcotics.org</a>&nbsp;or email:&nbsp;<a data-cke-saved-href=\"mailto:oakland@hopenothandcuffs.com\" href=\"mailto:oakland@hopenothandcuffs.com\">oakland@hopenothandcuffs.com</a></p><p style=\"text-align:center\"><br></p><p style=\"text-align:center\"><br></p>'),
(14, 'Connect', 'Life Groups - Bible Studies', '2--8a', '<p><span style=\"font-size: 24px;\">Men\'s Group<br></span><strong><span style=\"font-size:16px\">Meets: 7:30 PM on Tuesdays<br>Leader: Jeff Firestone 586-246-2711<br>Location: Crossroads Church Building​​​​​​​<br><br></span></strong><span style=\"font-size:24px\">Women\'s Group</span><br><strong><span style=\"font-size:16px\">Meets: 7:00 PM on Tuesdays<br>Leader: JoAnne Muzzi 248-345-6784<br>Location: Crossroads Church Building​​​​​​​</span></strong><span style=\"font-size: 24px;\"><br></span><span style=\"font-weight: bold; font-size: 14px;\">&nbsp; &nbsp; ​​​​​​​</span><br></p><p><span style=\"font-size:24px;\">Evening Bible Study</span></p><p><strong><span style=\"font-size:16px;\">Meets: 7:00 PM , 2nd and 4th Thursday of every month<br>Leader: Sherry Scott, (734) 968-2408<br>Location: Sherry Scott\'s South Lyon Home​​​​​​​</span></strong><br>​​​​​​​Reference books are used to assist us in our understanding of what God wants us to know. All are welcome to attend.</p><p>&nbsp;&nbsp;<br></p><p style=\"text-align: center;\"><br></p>'),
(15, 'Connect', 'Life Groups - Connection Groups', '2--8b', '<div><span style=\"font-size:24px;\"><br>​​​​​​​Men\'s Group</span><br><strong>Meets: 7:30 PM every Tuesday<br>Leader: Jeff Firestone (586) 246-2711<br>Location: Crossroads Church Building<br></strong>Reflection and discussion on Biblical books and themes. Currently using video based studies from RightNow Media.</div><div style=\"text-align: center;\"><br></div><div><span style=\"font-size:24px;\">Women\'s Fellowship</span><br><strong>Meets: 7:00 PM every Tuesday<br>Leader: JoAnne Muzzi (248) 345-6784<br>Location: Crossroads Church Building​​​​​​​<br></strong>Reflection and discussion on Biblical books and themes. Currently using video based studies from RightNow Media.<br></div><div><span style=\"font-size:24px;\"><br>Hand Crafting Group<br></span><strong>Meets: 6:30-8:30PM, July 20th &amp; August 3rd<br>Leader: Babe Kaier (248) -388-8436<br>Location: Crossroads Church Building​​​​​​​<br></strong>This groups share a passion for all types of crafts AND being together and building relationships. As well as completing crafts that benefit the church and other ministries.<br><span style=\"font-size:24px;\"></span><br></div><div><span style=\"font-size:24px;\">\"Life Between The Pages\"&nbsp;<br></span></div><div><span style=\"font-size:14px;\"><strong>Meets: Taking a break for the summer<br>Leader: Lynnette Viers (248) 437-2263<br>Location: Crossroads Church​​​​​​​ Building</strong></span><p>The book club meets on the second Monday of the month from September through May.<br>The group decides together what the monthly reading selections will be. The group leader provides a list of books to get things started and members bring their suggestions as well. Members of the group use a variety of reading resources which include the traditional hard cover and paperback books, Kindles, I-Pads and audio books. Discussions are lively and interesting, providing a wide range of perspectives.<br>​​​​​​​<br></p><div><strong><span style=\"font-size:24px\">20 Sumthin\'s</span></strong></div><div><span style=\"font-size:16px\"><strong></strong></span><span style=\"font-size:14px;\"><strong>Meets: 6:30pm - July 11th &amp; July 25th<br>Leader: Phil A. (248) 396-6305<br>Location: Pastor Phil\'s Home&nbsp;</strong></span><span style=\"font-size:16px\"><strong><br><br></strong></span><strong><span style=\"font-size:24px\">Mom\'s Group</span></strong><br><span style=\"font-size:14px;\"><strong>Meets: Taking a break for the summer<br>Leader: Jessica Walker (248) 787-0378<br>Location: Crossroads Church Building</strong></span><br><br></div></div><div style=\"text-align: center;\">​​​​​​​<span style=\"font-size:16px;\"><br></span><br></div>'),
(16, 'Connect', 'Life Groups - Support Groups', '2--8c', '<div><span style=\"font-size:24px;\"><br>​​​​​​​Al-Anon<br></span></div><div><span style=\"font-size:16px;\"><strong>Meets: Every Monday at 7:30PM<br>Leader: Jennifer C. (248) 321-9702 &amp; Laura (248) 444-9646<br>Location: Crossroads Church (The Garage)<br><br></strong></span><span style=\"font-size:12px;\">In Al-Anon, members do not give direction or advice to other members. Instead, they share their personal experiences and stories, and invite other members to “take what they like and leave the rest”-that is, to determine for themselves what lesson they could apply to their own lives. Personal contact is an important element in the healing process. Al‑Anon members come to understand problem drinking as a family illness that affects everyone in the family. At Al‑Anon meetings, you can hear how they came to understand their own role in this family illness. This insight put them in a better position to play a positive role in the family’s future.</span><br><br><span style=\"font-size: 24px;\">AA Meetings<br></span><strong style=\"\"><span style=\"font-size: 14px;\">Meets: Saturday Evenings at 8pm - July 16th, July 23rd &amp; July 30th<br>Leader: Jim (480) 247-9861<br>Location: Crossroads Church Building<br><br></span></strong><span style=\"font-size:24px\">AA Big Book Study<br></span><strong><span style=\"font-size:14px\">Meets: Sundays at 2pm - July 17th<br>Leader: Jared (734) 447-4095<br>Location: Crossroads Church Building</span></strong><br></div>'),
(17, 'About', 'Beliefs and Affiliations', '3--5', 'Crossroads is a member church of the Evangelical Covenant Church and we support the work and call of all Christians as they seek to live out lives of faith. Taking the call of Christ seriously we seek to love EVERYONE we come into contact with and live out the Good News in concrete actions in our world. Along with our Covenant brothers and sisters we affirm the following:<br><br><strong>Our place in the worldwide. Christian Church...<br><br></strong><p><strong>We are an apostolic church.</strong>&nbsp;We confess Jesus Christ and the faith of the apostles as recorded in the Holy Scriptures. We believe the authority of the Bible is supreme in all matters of faith, doctrine, and conduct, and it is to be trusted. “Where is it written?” was and is the Covenant’s touchstone of discussion with regard to faith and practice.</p><br><p><strong>We are a catholic church.&nbsp;</strong>The word catholic literally means universal. This means we understand ourselves to be a part of the community of believers that began with Jesus’s first followers, is alive today, and will continue until Christ comes again.</p><br><p><strong>We are a Reformation church</strong>.&nbsp;We stand in the mainstream of a church renewal movement of the sixteenth century called the Protestant Reformation. Especially important is the belief that we are saved by God’s grace alone, through faith alone, not by anything that we can do. The Covenant Church is also shaped by Pietism, a renewal movement that originated in seventeenth-century Europe and emphasized the need for a life that is personally connected to Jesus Christ, a reliance on the Holy Spirit, and a call to service in the world.</p><br><p><strong>We are an evangelical church</strong>.&nbsp;A series of religious awakenings flowered in Europe and America during the nineteenth century and provided rich soil for the early growth of the Covenant Church with our passion for mission. Evangelicals historically have been characterized by a strong insistence on biblical authority, the absolute necessity of new birth, Christ’s mandate to evangelize the world, the continuing need for education and formation in a Christian context, and a responsibility for benevolence and the advancement of social justice.<br><br><strong>Our identity and call to serve Christ in the world...<br></strong><br></p><p>For Covenant people, our essential beliefs are summed up in what we call Covenant Affirmations:</p><p><strong>We affirm the centrality of the word of God</strong>.&nbsp;We believe the Bible is the only perfect rule for faith, doctrine, and conduct. The dynamic, transforming power of the word of God directs the church and the life of each Christian. This reliance on the Bible leads us to affirm both men and women as ordained ministers and at every level of leadership. It is the reason we pursue ethnic diversity in our church and is the inspiration for every act of compassion, mercy, and justice.</p><br><p><strong>We affirm the necessity of the new birth</strong>.&nbsp;The Apostle Paul wrote, “If anyone is in Christ, the new creation has come” (2 Corinthians 5:17, TNIV). New birth in Christ means committing ourselves to him and receiving forgiveness, acceptance, and eternal life. It means being alive in Christ, and this life has the qualities of love and righteousness, joy and peace. New birth is only the beginning. Growing to maturity in Christ is a lifelong process for both individuals and communities of believers. God forms and transforms us-and it is through people transformed by Christ that God transforms the world.</p><br><p><strong>We affirm a commitment to the whole mission of the Church.</strong>&nbsp;The early Covenanters were known as “Mission Friends”- people of shared faith who came together to carry out God’s mission both far and near. Mission for them and for us includes evangelism, Christian formation, and ministries of compassion, mercy, and justice. We follow Christ’s two central calls. The Great Commission sends us out into all the world to make disciples. The Great Commandment calls us to love the Lord our God and our neighbors as ourselves.</p><br><p><strong>We affirm the Church as a fellowship of believers</strong>.&nbsp;Membership in the Covenant Church is by confession of personal faith in Jesus Christ and is open to all believers. We observe baptism and Holy Communion as sacraments commanded by Jesus. We practice both infant and believer baptism. We believe in the priesthood of all believers-that is, we all share in the ministry of the church. We also affirm that God calls some men and women into professional, full-time ministry. The church is not an institution, organization, or building. It is a grace-filled fellowship of believers who participate in the life and mission of Jesus Christ. It is a family of equals: as the New Testament teaches that within Christian community there is to be neither Jew nor Greek, slave nor free, male nor female, but all are one in Christ Jesus (Galatians 3:28).</p><br><p><strong>We affirm a conscious dependence on the Holy Spirit</strong>.&nbsp;The Covenant Church affirms the Trinitarian understanding of one God as Father, Son, and Holy Spirit. The New Testament tells us that the Holy Spirit works both within individuals and among them. We believe it is the Holy Spirit who instills in our hearts a desire to turn to Christ, and who assures us that Christ dwells within us. It is the Holy Spirit who enables our obedience to Christ and conforms us to his image, and it is the Spirit in us that enables us to continue Christ’s mission in the world. The Holy Spirit gives spiritual gifts to us as individuals and binds us together as Christ’s body.</p><br><p><strong>We affirm the reality of freedom in Christ.</strong>&nbsp;The Apostle Paul wrote, “It is for freedom that Christ has set us free” (Galatians 5:1, TNIV). This freedom is a gift of God in Christ, and it manifests itself in a right relationship with God and others. It is not a private gift to be used selfishly, but is given to serve the community and the world. For Paul, this freedom means that we are set free from the power of those things that on their own tend to divide. United in Christ, we offer freedom to one another to differ on issues of belief or practice where the biblical and historical record seems to allow for a variety of interpretations of the will and purposes of God. We in the Covenant Church seek to focus on what unites us as followers of Christ, rather than on what divides us.<br><br><strong>Conclusion...<br></strong><br>Crossroads and The Evangelical Covenant Church is a pilgrim church. Until Christ comes, we worship, serve, and witness so that the whole earth may hear God’s voice, learn of God’s love, and experience God’s joy.<br><br>For more information on worship at Crossroads, click here:&nbsp;<a data-cke-saved-href=\"https://www.ecrossroads.net/dev/connect/church_for_you.php\" href=\"https://www.ecrossroads.net/dev/connect/church_for_you.php\">Is This the Church for You?<br><br></a>For more information about the Covenant Church, click here:&nbsp;<a data-cke-saved-href=\"http://www.covchurch.org/who-we-are/beliefs/\" href=\"http://www.covchurch.org/who-we-are/beliefs/\"> http://www.covchurch.org/who-we-are/beliefs/</a><br></p>'),
(18, 'About', 'Our Staff - Joe Muzzi', 's--1', '<p><span style=\"font-size:18px;\">&nbsp;&nbsp;&nbsp;&nbsp;Joe and his wife JoAnne became a part of the Crossroads family in 1999. At that time Joe worked as a public school teacher in Dearborn and JoAnne worked as a physical therapist, a profession she continues in today. Joe heard the call to full-time ministry and left teaching to serve the church. He graduated from Ashland Theological Seminary in 2007 and was ordained by the Evangelical Covenant Church in 2011. He has served as the Lead Pastor of Crossroads since April of 2006. Joe and JoAnne have been married for 33 years, they have one son, Tony, who lives and works in the Detroit area.</span></p><p><span style=\"font-size:18px;\">&nbsp;&nbsp;&nbsp;&nbsp;Both Joe and JoAnne grew up in Detroit and went to Catholic churches and schools. While they are thankful for their upbringing they sensed a call to something different. Not quite sure what that might be, they did what a lot of people do, they went church shopping. The shopping ended when a good friend, who they always knew to be an atheist, told them he found a church and thought they might like it. They remember thinking any church that can welcome Eric, answer his questions and get him connected has to be a great place. That place was New Horizon and it truly was. New Horizon was a small church plant that ultimately closed its doors but when it did a group of the remaining members started to attend Crossroads because of its similar style of worship. From Joe: “I really want Crossroads to continue to be a place where questions are OK and God (Father, Son and Holy Spirit) is worshiped. We want to be a place where the disconnected or the burnt-out church-goer can connect with God and where long time followers of Christ can be encouraged, strengthened and challenged as they grow.”</span></p>'),
(19, 'About', 'Our Staff - Dave Chatel', 's--2', '<p><span style=\"font-size:18px;\">&nbsp;&nbsp;&nbsp;&nbsp;Dave and his wife Linda have been part of the Crossroads family since 2001. His services at Crossroads include Drama and preaching/teaching. Dave also is director of Renewed Hope Counseling Center which is on the property of Crossroads church. RHCC is a non-profit clinic that offers professional mental health care to anyone in the community using a sliding scale. Dave has a grown son Paul and two grandsons Ty and Cole. He graduated from Michigan Theological Seminary with a Master of Arts in Counseling Psychology and is a licensed psychologist. He is a licensed minister with the Evangelical Covenant Church.</span></p>'),
(20, 'About', 'Our Staff - Shannon Waroway', 's--3', '<span style=\"font-size:18px;\">&nbsp;&nbsp;&nbsp;&nbsp;Shannon has been leading in Children’s Ministry since 2001 She specializes in teaching the children about Jesus Christ in ways that are fun, active and full of learning. She has a great team of volunteers that frequently includes her husband Mike. Highlights of the children’s ministry include the Sunday lessons, Summer VBS, Christmas VBS, Harvest Party and Easter Egg Hunt. Shannon always has something fun going on for the children of Crossroads.</span>'),
(21, 'About', 'Our Staff - Jen Niemi', 's--4', '<p><span style=\"font-size:18px;\">&nbsp;&nbsp;&nbsp;&nbsp;Jen and her husband Mark have been part of the Crossroads family since its beginning. She leads the Music and Tech team with a combination of reverence for God and joy.</span></p><p><span style=\"font-size:18px;\">&nbsp;&nbsp;&nbsp;&nbsp;From Jen: “I’ve been coming to this church since the doors first opened. I’m so glad to be working here – doing what I love, and being able to use the gifts God has given me. This church is my extended family, and it’s great being loved &amp; encouraged by so many wonderful people!”</span></p>'),
(22, 'About', 'Our Staff - Linda Chatel', 's--5', '<span style=\"font-size:18px;\">&nbsp;&nbsp;&nbsp;&nbsp;Linda and her husband Dave have been a part of the Crossroads family since 2001. Linda previously worked in banking for 18 years than was a church office manager and bookkeeper for 17 plus years. She handles the churches finances/accounting, facility issues and communications. She also oversees the Annual Garage Sale at Crossroads.</span>'),
(23, 'About', 'Our Staff - Laura Podgorny', 's--6', '<span style=\"font-size:18px;\">&nbsp;&nbsp;&nbsp;&nbsp;Laura and her family have been a part of the Crossroads family since before 2008. Laura volunteers as the Coffee Service Ministry’s leader so, please make sure to enjoy a hot cup of java or tea before a Sunday service. She also participates with the Communication Team by providing service announcements, and has also delivered messages on Member Preach Sunday.</span>');
