(24859, 'om_notifications', 'a:4:{s:7:\"updated\";i:1692997844;s:4:\"feed\";a:1:{i:0;a:8:{s:5:\"title\";s:86:\"G2 Awards OptinMonster Best ROI, Easiest Setup, Most Implementable and 17 More Awards!\";s:7:\"content\";s:406:\"G2, the largest software marketplace and services review platform, recognized OptinMonster as the “Best ROI” Popup Builder and Personalization software, in both the Small Business and Mid-Market segments. Best ROI was just one of 20 honors awarded to OptinMonster for the Summer 2023 awards. Learn what the other 19 were, and how we\'re always working on your behalf to help you win, and win more often!\";s:6:\"levels\";a:2:{i:0;s:3:\"all\";i:1;s:4:\"none\";}s:2:\"id\";i:181292;s:4:\"type\";s:7:\"success\";s:5:\"start\";s:19:\"2023-08-17 00:00:00\";s:7:\"created\";i:1692230400;s:4:\"btns\";a:1:{s:4:\"main\";a:2:{s:3:\"url\";s:127:\"https://optinmonster.com/g2-awards-for-popup-builders-summer-2023/?utm_source=wordpress&utm_medium=notification&utm_campaign=g2\";s:4:\"text\";s:15:\"View the Awards\";}}}}s:6:\"events\";a:0:{}s:9:\"dismissed\";a:0:{}}', 'no'),
