(5, 1, '2019-01-29 18:42:36', '2019-01-29 18:42:36', '<p>This is the WPForms preview page. All your form previews will be handled on this page.</p><p>The page is set to private, so it is not publicly accessible. Please do not delete this page :) .</p>', 'WPForms Preview', '', 'private', 'closed', 'closed', '', 'wpforms-preview', '', '', '2019-01-29 18:42:36', '2019-01-29 18:42:36', '', 0, 'http://jordanhalaby.com//index.php/wpforms-preview/', 0, 'page', '', 0);
